exports=async function(url,bid,cid,options){const{parseContent}=await require("transcode/parse_content");return parseContent(url,"div.content",{clientOptions:{...(options&&options.clientOptions)},preprocess:html=>html.replace(/<center>\s*<div[^>]*>\s*<ins[^>]*>[^<]*<\/ins>\s*<\/div>\s*<\/center>|<amp-[^>]+>[^<]*<\/amp-[^>]+>/g,"")})};